import React from 'react';
import ReactDOM from 'react-dom';
import UserImage from "../images/user1.png";
import './card.css'
import StartLogo from "../images/start.png";

export default function Card() {

    return (
        <div>
            <img src={UserImage} className='user-image' />
            <p><img src={StartLogo} />
                <spam id='card-count'>(6)</spam>
                <spam></spam><spam></spam></p>
        </div >
    );

}
